 insert into `GOODS_MASTER`(`GOODS_ID`,`GOODS_NAME`,`GOODS_POINT`,`GOODS_INFO_1`,`GOODS_INFO_2`,`IMAGE_PATH`,`GOODS_CATEGORY`,`GOODS_RANK`,`MAX_EXCHANGE_COUNT`,`INSERT_DATE`,`INSERT_USER`,`UPDATE_DATE`,`UPDATE_USER`,`DELETE_FLAG`) values 
     ('00000001','ツムラ日本の名湯　温もりにごり選',200,'おうちのお風呂で温泉気分。日本各地の温泉を巡り、温泉分析表にもとづいて開発したイオン組成の「ツムラの日本の名湯」シリーズから、5種類のにごり湯をゆっくり味わっていただけます。','セット内容:登別カルルス（30ｇ）×2包、山代（30ｇ）×2包、濁河（にごりご）（30ｇ）×2包、紀州龍神（30ｇ）×2包、黒川（30ｇ）×2包','5639PCL.jpg','12','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000002','ブタの落としぶた',200,'かわいいだけではありません。この落としぶたはシリコン製。高温にも耐え、繰り返し使えます。煮物以外にもラップ代わりに食器にかぶせて、電子レンジでの使用もOKです。','素材：シリコンゴムφ175×H26mm（本体）95g','5427PCL.jpg','02','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000003','世界の子どもたちに希望と笑顔を届けよう！',200,'世界では貧困や紛争、災害などによって、多くの子どもたちの健やかな成長が妨げられています。子どもたちの未来をひらき、夢を持って歩めるように支援する、児童保護基金にご協力ください。',null,'5012PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000004','世界の子どもたちのためにユニセフへ寄付しよう！',200,'ユニセフ（国際連合児童基金）は、世界150以上の国と地域で、子どもたちの生命と健やかな成長を守るために活動する国連機関です。',null,'5010PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000005','世界の子どもたちの教育を支援しよう！',200,'生まれた国と社会環境によって、読み・書き・計算すら学ぶ機会のなかった大人や子供が約10億人もいます。日本ユネスコ協会連盟の世界寺子屋運動は、貧しい村々に寺子屋教室を開き、基礎的な学習や生活をよくするための職業訓練活動を応援し、途上国の人々とお申し込みいただいたポイント相当額を（社）日本ユネスコ協会連盟の世界寺子屋運動に寄付いたします。',null,'5003PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000006','世界の自然を守るためにＷＷＦへ寄付しよう！',200,'WWFは、約100カ国で活動している地球環境保全団体です。人と自然が調和して生きられる未来を築くために、ぜひあなたの力を貸してください。',null,'5011PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000007','地球のためにできることを応援しよう！',200,'今、世界では、地球温暖化や生態系の破壊、森林の減少、大気・水の汚染など、さまざまな環境問題が起きています。地球環境基金は、このような環境問題解決のための環境NGO・NPOをサポートしています。',null,'5013PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000008','多機能キッチンバサミ',200,'肉、野菜、パックなど何でも楽に使用できます。特にレトルトパックを熱湯から取り出し、その中身を搾り出す機能にすぐれています。金属部分のコーティングによりサビや嫌な臭いも付きにくくなっています。','W228×D73×H12mm（本体）100g','5418PCL.jpg','02','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000009','大画面キッチンタイマー',200,'大きい数字のはっきり表示が見やすいキッチンタイマー。10分・1分・10秒刻みで、簡単にセットできます。強力マグネットと壁掛けフック、スタンド付で、普段は時計としても使えます。',' W80×D19.5×H80mm（本体）約62ｇ 付属品:単4電池×1本','6478PCL.jpg','01','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000010','日本の森をもっと豊かにしよう！',200,'音楽家・坂本龍一氏の呼びかけで設立された森林保全団体more treesでは、国内外での森づくりに取り組んでいます。',null,'5014PCL.jpg','08','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000011','楽天スーパーポイント',200,'みずほマイレージクラブカード限定','楽天のスーパーポイントへの交換ができます。','4046PCL.jpg','07','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000012','西武百貨店オリジナル　エコロジーバッグ',200,'かわいらしい｢お買物クマ｣がプリントされたエコバッグです。たたんでおけばとても小さくなり、荷物が増えたときにも安心です。','約W340×D100×H400ｍｍ　素材：ポリエステル　色：ベージュ','5721PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000013','ＡＮＡマイレージクラブ',200,'みずほマイレージクラブカード限定','ANAのANAマイレージクラブへのマイル交換ができます。','4045PCL.jpg','07','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000014','【期間限定】キャス・キッドソン　クラッシュマグ　ストロベリー',300,'キャス・キッドソンのクラッシュマグは、英国のチャーチル社製。コロンとしたシェイプに、大人気のキュートなストロベリー柄。カフェオレ、ミルクティーなどをたっぷりと楽しめる、大きめのマグカップです。','φ100×H110mm　容量：約500ml　素材：陶器　※電子レンジ・食器洗浄機可、オーブンレンジ・直火不可','3334PCL.jpg','11','7',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000015','【期間限定】キャス・キッドソン　クラッシュマグ　スプリッグ',300,'【期間限定】キャス・キッドソン　クラッシュマグ　スプリッグ','φ100×H110mm　容量：約500ml　素材：陶器　※電子レンジ・食器洗浄機可、オーブンレンジ・直火不可','3336PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000016','【期間限定】キャス・キッドソン　クラッシュマグ　ランブリングローズ',300,'キャス・キッドソンのクラッシュマグは、英国のチャーチル社製。コロンとしたシェイプに、大きな花柄が大人っぽい、洗練されたデザインです。カフェオレ、ミルクティーなどをたっぷりと楽しめる、大きめのマグカップです。','φ100×H110mm　容量：約500ml　素材：陶器　※電子レンジ・食器洗浄機可、オーブンレンジ・直火不可','3335PCL.jpg','11','7',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000017','オムロン　電子体温計',300,'ワキ下や口内で正確な体温を測る実測式体温計で、測り終えたら電子音で知らせてくれます。電源を切り忘れても自動的に電源オフ。電池交換もできます。','W19.6×D129.7×H13.2mm（本体）約13ｇ 型番:MC171W','5638PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000018','サッカー日本代表　マフラータオル',300,'日本代表チームの新エンブレムとサムライブルーのロゴをプリントしたマフラータオル。永久不滅ポイントのオリジナルアイテムです。首に巻いて、手に持って、日本代表を応援してください。','約W1100×D210mm（本体）　顔料プリント　素材:綿100％','5912PCL.jpg','13','7',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000019','オリジナルハンカチセット（ＲＨＳＪ監修）',400,'キャロライン・マリア・アップルビーが描いた水彩画のパンジーとコウシンバラが、美しい２枚のハンカチになりました。大判サイズです。','素材：綿１００％　約W500×H500ｍｍ','5858PCL.jpg','04','7',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000020','サッカー日本代表　エンブレムＴシャツ',400,'左胸に日本代表チームの新エンブレム、背中にサムライブルーのロゴを配し、赤のパイピングをあしらった、おしゃれなVネックＴシャツ。永久不滅ポイントのオリジナルアイテムです。試合観戦やスポーツの際にご愛用ください。','サイズ:フリー（身丈約700mm、身幅約550mm）　素材:ポリエステル100％','5910PCL.jpg','04','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000021','ドリテック　スプーンスケール',400,'容器を使わずにはかれるスプーン型微量計。','W220×D50×H30mm（本体）50g　素材：ポリプロピレン　型番：PS-031','3356PCL.jpg','02','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000022','バスクロック　フラット',400,'付属品：単３電池×１個、吸盤　※壁の種類によって、吸盤が付かない場合がございます。','Ｗ90×Ｈ90×Ｄ40ｍｍ（本体）160ｇ','5633PCL.jpg','12','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000023','ロクシタン　シアハンドケアセット',400,'シアの木の実から取れる保湿クリームシアバターは、フェイスやボディ、手、爪、唇などにお使いいただけるマルチバームです。シアバター20%配合のシアハンドクリームは、リッチなテクスチャーながら、すばやく浸透し、乾燥からしっかりと手指を守ります。','セット内容:シアバター（8ml）×1個、シアハンドクリーム（30ml）×1本　※商品のラベルデザインが変更になる場合がございます。','5633PCL.jpg','14','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000024','オリジナルマグカップ（ＲＨＳＪ監修）',500,'ウィリアム・フッカーによるサクランボを、手になじみやすいマグカップに仕上げました。ボーンチャイナの白に映えるアクセントカラーのグリーン。サクランボと花が印象的です。','素材：陶磁器　カップ：φ約83×H約91mm（本体）190ｇ　容量：約250ml','6473PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000025','ソレアード　２カップコーヒーメーカー',500,'陶製のマグカップをホワイトの本体にセットして、2杯同時に本格的なコーヒーをいれることができるコーヒーメーカーです。忙しい朝でも気軽にコーヒーを楽しめます。※水の量を調整することで、一杯分入れることもできます。※保温機能はございません。','W173×D138×H235mm（本体） 1.2kg　付属品：マグカップ2客','5415PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000026','タニタ　クッキングスケール',500,'透明の大きな窓でメモリがはっきりと見えます。引き出しにすっきりおさまる薄型で、持ち運びにも便利な手のひらサイズ。グッドデザイン賞・ロング賞をダブル受賞しています。','"最大計量：1","000g 最小計量：5.0g"','5414PCL.jpg','02','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000027','ヘンケルス　三徳包丁ブラック',500,'どのように握っても快適なグリップが得られる非対称ハンドル。','W305×D25×H50mm（本体）104g　素材：特殊刃物鋼、ポリプロピレン樹脂　型番：16717-181','3351PCL.jpg','02','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
   , ('00000028','メッシュ傘立て',500,'メッシュでできたスリムな傘立てです。玄関で場所をとりません。また、すっきり収納のトイレットペーパー入れとしても使えます。','素材：スチール（エポキシ加工）φ160（内径128）×H530mm（本体）850g','5824PCL.jpg','11','1',null,DATE '2011-04-01','0000',DATE '2011-04-01','0000','0')
